import React, { Component } from 'react'
import PropTypes from 'prop-types'

export class StockItem extends Component {
    render() {
        const share = this.props.share;
        return (
            <tr>
                <td> {share.ticker} </td>
                <td> {share.volume} </td>
                <td> {share.time} </td>
            </tr>
        )
    }
}

// Proptypes
/*StockItem.PropTypes = {
    StockItem: PropTypes.object.isRequired
}*/
export default StockItem
